const teamMembers = [
  { name: "John Doe", position: "CEO & Founder" },
  { name: "Jane Smith", position: "Chief Financial Officer" },
  { name: "Michael Johnson", position: "Senior Tax Advisor" },
  { name: "Emily Davis", position: "Lead Accountant" },
  { name: "Robert Wilson", position: "Business Consultant" },
  { name: "Sarah Brown", position: "Client Relations Manager" }
];

export default function Team() {
  return (
    <section className="py-20 px-6 bg-gray-50">
      <h2 className="text-3xl font-bold text-center mb-12">Meet Our Team</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8 max-w-6xl mx-auto">
        {teamMembers.map((member, i) => (
          <div key={i} className="bg-white p-6 rounded-lg shadow-lg text-center">
            <div className="h-40 bg-gray-200 mb-4 rounded-lg"></div>
            <h3 className="text-xl font-semibold">{member.name}</h3>
            <p className="text-gray-600">{member.position}</p>
          </div>
        ))}
      </div>
    </section>
  );
}
